import React from 'react'
import './style.css';
import { t } from 'i18next';

function SettingsPanel() {
  return (
    <ul class="panel" role="menu">
      <SearchSettings />
      <AdvancedSearch />
      <YourDataInSearch />
      <SearchHistory />
      <SearchHelp />
      <SendFeedback />
      <DarkTheme />
    </ul>
  )
}

const SearchSettings = () => (
  <li>
      <a href="https://www.google.com/preferences" alt="Search settings">
          {t('search_settings')}
      </a>
  </li>
);

const AdvancedSearch = () => (
  <li>
      <a href="https://www.google.com/advanced_search" alt="Advanced search">
          {t('advanced_search')}
      </a>
  </li>
);

const YourDataInSearch = () => (
  <li>
      <a href="https://myaccount.google.com/yourdata/search?utm_source=googlemenu" alt="Your data in search">
          {t('your_data_in_search')}
      </a>
  </li>
);

const SearchHistory = () => (
  <li>
      <a href="https://www.google.com/history/optout" alt="Search history">
          {t('search_history')}
      </a>
  </li>
);

const SearchHelp = () => (
  <li>
      <a href="https://support.google.com/websearch/#topic=3378866" alt="Search help">
          {t('search_help')}
      </a>
  </li>
);

const SendFeedback = () => (
  <li>
      <a href="https://www.google.com/tools/feedback/" alt="Send feedback">
          {t('send_feedback')}
      </a>
  </li>
);

const DarkTheme = () => (
  <li>
      <a href="#" alt="Settings">
          {t('dark_theme_off')}
      </a>
  </li>
);

export default SettingsPanel
